import React, { useState } from 'react';
import { Form, Input, DatePicker, Button, message } from 'antd';
import axios from 'axios';

const { RangePicker } = DatePicker;

const RegistroSiniestroForm = () => {
    const [loading, setLoading] = useState(false);

    const onFinish = async (values) => {
        setLoading(true);
        try {
            await axios.post('http://localhost:8000/Siniestros/RegistrarSiniestro', values);
            message.success('Siniestro registrado correctamente');
        } catch (error) {
            message.error('Error al registrar el siniestro');
        }
        setLoading(false);
    };

    return (
        <Form
            layout="vertical"
            onFinish={onFinish}
        >
            <Form.Item
                name="Numero_Siniestro"
                label="Número de Siniestro"
                rules={[{ required: true, message: 'Por favor ingresa el número de siniestro' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Folio_Edua"
                label="Folio EDUA"
                rules={[{ required: true, message: 'Por favor ingresa el folio EDUA' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Fechas"
                label="Fechas"
                rules={[{ required: true, message: 'Por favor selecciona las fechas' }]}
            >
                <RangePicker showTime />
            </Form.Item>
            <Form.Item
                name="Numero_Poliza"
                label="Número de Póliza"
                rules={[{ required: true, message: 'Por favor ingresa el número de póliza' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Serie_Vin"
                label="Serie VIN"
                rules={[{ required: true, message: 'Por favor ingresa la serie VIN' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Placa_Vehiculo"
                label="Placa del Vehículo"
                rules={[{ required: true, message: 'Por favor ingresa la placa del vehículo' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Estado"
                label="Estado"
                rules={[{ required: true, message: 'Por favor ingresa el estado' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                name="Ciudad"
                label="Ciudad"
                rules={[{ required: true, message: 'Por favor ingresa la ciudad' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item>
                <Button type="primary" htmlType="submit" loading={loading}>
                    Registrar Siniestro
                </Button>
            </Form.Item>
        </Form>
    );
};

export default RegistroSiniestroForm;
